import React from 'react';
import { connect } from 'react-redux';
import { addYear } from '../redux/Form';

const Year = (props) => {
    handleChange = (e) => {
        props.addYear(e.target.value)
    }
    return (
        <div className="input-container">
            <input 
                type="number" 
                maxLength="4"
                value={props.form.year} 
                onChange={this.handleChange}
                name="year" 
                placeholder="Must be 4 digits"
                className="offer-input" 
                />    
        </div>
    )
}

export default connect(state => state, { addYear })(Year)
